import styled from "styled-components";

export default styled.div`
    position: relative;
    background-image: linear-gradient(#3151D6 -35vh, white 18vw);
    font-family: ${props => props.theme.font};
    font-weight: 700;
    top: -5vh;
    margin-left: auto;
    margin-right: auto;
    color: white;
    width: 12vw;
    text-align: center;
    border-radius: .8vw;
    border-width: .2vw;
    padding: 10px;
`;
